import { Button } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";

const OneKey = ({keyitem}, key) => {
    const allkeys = useSelector(state => state.employees.allKeys)
    const dispatch = useDispatch()
    return (
        allkeys.employeeid === "null"?
        <tr key={key}>
            <td>{keyitem.keyid}</td>
            <td>{keyitem.cabinet}</td>
            <td><Button>Сотрудник</Button></td>
            <td><Button variant="danger">Удалить ключ</Button></td>
        </tr>
        :
        <tr key={key}>
            <td>{keyitem.keyid}</td>
            <td>{keyitem.cabinet}</td>
            <td><Button>Занят</Button></td>
            <td><Button variant="danger">Удалить ключ</Button></td>
        </tr>
    );
};

export default OneKey;
